data.value:
Användaren ska utrusta programvaran och programvarans funktioner (inklusive men inte begränsat till att skapa nya instanser) med den hårdvaru- och programvarukonfiguration som krävs av användaren.
Användare ska ansvara för relevanta telefon- och bredbandsanvändningsavgifter som måste betalas efter anslutning till Internet.
Användaren ska bära det juridiska ansvaret för beteende, händelse och resultat som orsakas av användningen av denna programvara.
Eventuella transaktioner och tvister mellan användare och andra obehöriga inofficiella personer har inget att göra med utvecklaren.
Användaren ska följa relevanta lagar och förordningar i Folkrepubliken Kina (om användaren är en användare utanför Folkrepubliken Kina ska användaren också följa lagar och förordningar i det land eller den region som den tillhör).
Användaren får inte använda programvaran (eller vissa funktioner och funktioner i programvaran) för att begå olagliga handlingar, och får inte använda de relevanta processer och tjänster som är förknippade med programvaran för att begå olagliga handlingar, och konsekvenserna av eventuella åtgärder ska inte vara relaterade till utvecklaren.
Användarna ska bära sitt eget juridiska ansvar i samband med innehållet i den information de publicerar. Användaren får inte mata in, publicera eller sprida något av följande innehåll i programvaran, de processer och tjänster som är relaterade till driften av programvaran, och får inte publicera något av följande innehåll i någon form：

motsätta sig de grundläggande principer som anges i Folkrepubliken Kinas konstitution;
äventyra den nationella säkerheten, sprida statshemligheter, undergräva statsmakten eller undergräva den nationella enigheten,
skada statens ära och intressen;
uppvigling till etniskt hat, etnisk diskriminering eller undergrävande av etnisk enighet;
undergräva den nationella religionspolitiken, förespråka kulter och feodal vidskepelse;
sprida rykten, störa den sociala ordningen eller undergräva den sociala stabiliteten;
Spridning av obsceniteter, pornografi, hasardspel, våld, mord, terror eller anstiftan till brott;
förolämpa eller förtala andra, inkräkta på andras lagliga rättigheter och intressen;
Innehåller annat innehåll som är förbjudet enligt lagar eller administrativa bestämmelser.
Om det inte är tillåtet enligt lag eller med skriftligt tillstånd från utvecklaren får användarna inte delta i någon av följande handlingar：
Olaglig eller olämplig användning av programvaran och tjänsterna;
Skada den normala driften av programvaran, systemet eller webbplatsen, avsiktligt sprida datavirus och andra destruktiva program;
Vidta något onormalt användningsbeteende som kan påverka programvarans nätverkstjänster (inklusive men inte begränsat till att skada, attackera servern eller överbelasta servern, etc.);
Ta bort copyrightinformationen för programvaran och dess kopior.

Om användaren begår något beteende som bryter mot lagar och förordningar eller bryter mot bestämmelserna i detta avtal, har utvecklaren rätt att vidta åtgärder mot användaren beroende på situationens allvar, i enlighet med detta avtal och lagar och förordningar, inklusive men inte begränsat till att avsluta tjänster. Om omständigheterna är allvarliga kommer de att överföras till de berörda förvaltningsorganen för administrativa påföljder eller utredas för straffrättsligt ansvar.

Om du godkänner dessa användarvillkor och använder programvarans onlinetjänster kommer vi att samla in följande information：
IP-adressen för den enhet som programvaran körs på (vilket kanske inte är den korrekta adressen);
Viss systeminformation om den utrustning som programvaran drivs på;
När programvaran kraschar kan loggarna för programvaran som körs på systemet (inklusive viss systeminformation) laddas upp med användarens medgivande för att hjälpa till att lösa problemet och förbättra programvaran.
Annan information som kommer att laddas upp med användarens samtycke (enligt vad som anges i programvaran).

1. Avstängning och uppsägning av Användarens Tjänst

Om användaren publicerar olaglig information, allvarligt bryter mot samhällsmoralen eller bryter mot lagens förbud, ska utvecklaren säga upp tillhandahållandet av tjänster till användaren;
Om användaren begår en olämplig handling när han eller hon accepterar programvarutjänsten har utvecklaren rätt att säga upp den tjänst som tillhandahållits användaren (de specifika omständigheterna för det felaktiga beteendet anges tydligt i detta avtal);
Om användaren använder en modifierad version av programvaran från en tredje part ska användaren bära sin egen risk och sitt juridiska ansvar.

2. Avstängning, avstängning och uppsägning av programvaran och tjänsterna：

I händelse av någon av följande omständigheter har utvecklaren rätt att säga upp eller avbryta alla eller delar av programvarans tjänster, och utvecklaren ska inte vara ansvarig gentemot användaren eller någon tredje part för de olägenheter eller skador som orsakas av detta：

a. i enlighet med vad som krävs av Programvaran och Tjänsterna;
b. Underlåtenhet att fungera korrekt på grund av skada på servern;
c. På grund av plötsligt fel på mjukvaru- och hårdvaruutrustning och elektronisk kommunikationsutrustning;
d. på grund av nätverksleverantörens linjefel eller andra fel;
e. på grund av politiska överväganden;
f. Skäl till tredje part eller andra force majeure-omständigheter.

Utvecklaren förbehåller sig rätten att säga upp eller delvis avsluta Programvaran och Tjänsterna när den anser det nödvändigt, och Utvecklaren kan meddela Användaren i form av ett meddelande, men Utvecklaren ansvarar inte för eventuella förluster som orsakas Användaren.

Detta avtal ska regleras av Folkrepubliken Kinas lag, utan hänsyn till alla lagvalsregler;
Utvecklarens underlåtenhet att utöva, underlåta att i tid eller fullt ut utöva de rättigheter som åtnjuts enligt detta avtal eller i enlighet med lagen ska inte anses vara ett avstående från utövandet av sådana rättigheter, och det ska inte heller påverka utvecklarens utövande av sådana rättigheter i framtiden;
I den utsträckning det är tillåtet enligt lag har utvecklaren rätt att tolka villkoren i detta avtal;
Användare kan klaga och rapportera alla typer av överträdelser av lagar och förordningar via e-post, skicka e-postmeddelandet till services@mcsl.com.cn.
